
QExtendClass("Omi\\View\\UserPasswordRecovery","QWebControl",{});function save(){var e=jQuery(this);var d=e.closest("form");if(!d.length>0){return}var a=d.find("#newpass");var b=d.find("#currentpass");if(!b.val()){alert("Parola curenta este necesara pentru schimbarea parolei!");b[0].focus();return}var c=d.find("#newpassconfirm");if(!c.val()){alert("Parola noua trebuie confirmata!");c[0].focus();return}else{if(a.val()!==c.val()){alert("In campul confirma parola trebuie reintrodusa parola noua!");c[0].focus();return}}d[0].submit()};